import styled from "styled-components";



function Button(props){

    const ButtonB = styled.button` 
    
  font: inherit;
  border: 5px solid #4f005f;
  border-radius: 25px;
  background: #4f005f;
  color: white;
  padding: 0.25rem 1rem;
  cursor: pointer;


&:hover,
&:active {
  background: #741188;
  border-color: #741188;
}

&:focus {
  outline: none;
}`
    return (
<ButtonB onClick={props.onClick}>
    {props.children}
</ButtonB>
    )
}


export default Button;
